import React from 'react'
import "./Footer.css"
import {AiOutlineInstagram} from 'react-icons/ai'
function Footer() {
  return (
    <div className="containerFooter">
        <p>Made with love by Benedetto Giallombardo</p>
        <AiOutlineInstagram/>
    </div>
  )
}

export default Footer
